import React from "react";

export function Examenes(props) {
    const data = [['Covid 19','Examen Isopado '],['Antiquenos','sadad lkjadslkj']]
  return (
    <div className="container bg-white min-h-screen">
      <button>Agregar Examen</button>

      <table>
        <thead>
          <tr>
            <th>Examen</th>
            <th>Descripcion</th>
          </tr>
        </thead>
        <tbody>
          {data.map((element) => {
            return (
              <tr>
                <td>{element[0]}</td>
                <td>{element[1]}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
